      | 364355 -> { ItemTypeData.id= 364355; name= "Callisto"; published= false; description= "The Light Attack Vehicle (LAV) represents a new generation of mobile support vehicle, an agile and effective unit, adept at assisting both infantry and other vehicles on the battlefield with its cadre of electronic warfare subsystems and all-terrain maneuverability modules. Whether employed as a scout vehicle or as an anti-infantry unit, the LAV is a ubiquitous part of New Eden’s modern battlefield.    The Scout class LAV is a high speed, highly maneuverable vehicle optimized for guerilla warfare; attacking vulnerable targets and withdrawing immediately or using its mobility to outmaneuver slower targets.  These LAVs are relatively fragile but occupants enjoy the benefit of increased acceleration and faster weapon tracking.  "; marketGroupId= None; groupId= 351210; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 1.000000; volume= 0.000000 } |> Some
      | 364743 -> { ItemTypeData.id= 364743; name= "Frontline - GA"; published= false; description= "The Assault dropsuit is a versatile frontline combat suit that combines excellent protection, good mobility, and sufficient hard points for mission-specific customizations.  Gallente forces have access to some of the most advanced armor systems in the cluster. An ablative-variant solution is used to dissipate energy across available surface area with only minimal degradation of the material at the impact point resulting in armor that is efficient and durable enough to maintain operational integrity for multiple short-term engagements. Augmented ferro-fibre musculature enhances the soldier’s strength, balance, and reaction time, while quad-opsis sensors allow wide arc identification and prioritization of battlefield targets.  Assault dropsuits are intended for standard combat operations or those in which the objectives are likely to change at a moment’s notice. Its ability to carry anything from small arms and explosives to anti-vehicle munitions and deployable support gear makes it the most adaptable direct combat suit on the battlefield."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 36495 -> { ItemTypeData.id= 36495; name= "Men's 'Hephaestus' Pants (desert)"; published= true; description= "Designer: Vallou Outerwear  When Outer Ring Excavations was looking to update and modernize their crew uniforms, they relied on Vallou Outerwear to take on the challenge. Vallou upper management was so impressed with the result, they commissioned a limited range of custom variants, known as the “Hephaestus” collection.   These functional but high tech pants retain the utilitarian look of the original uniforms, but with much higher material quality and attention to detail. Each pair of pants are crafted from desert-shaded camo poly fabrics that are extremely durable yet comfortable enough to wear for extended periods. Additional pockets, straps and utility belts allow for a wide range of tools to be carried with the wearer while performing their duties.  "; marketGroupId= Some(1401); groupId= 1090; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 0.100000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.500000 }; { DogmaAttributeValueData.attributeId = 1773; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 } |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.500000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
      | 365325 -> { ItemTypeData.id= 365325; name= "'Neo' Scout M/1-Series"; published= false; description= "The Scout dropsuit is a lightweight suit optimized for enhanced mobility, multi-spectrum stealth, and heightened awareness. Augmented joint servo motors give every movement extra speed and flexibility, while integrated friction and impact dampening materials reduce the overall sound signature.     Biotic augments make this suit ideal for a melee-focused role. Woven into the suit, a tremor membrane saturates muscles with nutrients amplifying the cross-sectional force of physical strikes. Combined with rigorous training, this temporarily enhanced strength and dexterity make the Minmatar Scout almost unmatched in hand-to-hand combat.     When missions call for speed and stealth, situations in which heavily armored suits would be more of a burden than an advantage, a scout dropsuit is the best option. The enhanced mobility it provides makes up for its relatively low protection, and when combined with stealth technology modules, the scout suit is the obvious choice for infiltration, counter-espionage, and assassination."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 365713 -> { ItemTypeData.id= 365713; name= "'Pyrus' Logistics A/1-Series"; published= false; description= "Utilizing sub-licensed technology sourced from all across the cluster, Allotek Industries’ Pyrus product line offers a wide range of dropsuit and weapon variants developed and manufactured in accordance with the corporation’s stringent guidelines to ensure that all products are worthy of carrying the Allotek quality guarantee."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
