      | 366004 -> { ItemTypeData.id= 366004; name= "Cloak Field"; published= false; description= "The cloak field absorbs electromagnetic emissions and manipulates light to render the dropsuit practically invisible. When active, the field alters the magnetic permeability of the suit’s surface area to generate a negative refractive index.     While cloaked, the suit’s susceptibility to magnetometric waves is moderately reduced, allowing it to evade all but the most sensitive scanning systems. However, cascading distortion introduced by weapon or equipment activation will desychronize the suit’s sensors and short-circuit the cloak."; marketGroupId= None; groupId= 351844; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 366101 -> { ItemTypeData.id= 366101; name= "Federation CreoDron Specialist Shotgun"; published= false; description= "Designed for close-range combat, the shotgun is a spread weapon with tremendous stopping power. Unlike traditional cyclotron designs, a walled centrifugal well is used to simultaneously shunt dozens of plasma charges, generating a wide-pattern ‘kill spread' that is lethal over short distances.    The excessive recoil produced by each discharge is absorbed by the pneumatic armature, allowing the weapon to be fired repeatedly without significant injury to the user. The operator controlled crank-action flushes coolant through the interior well before cycling additional rounds into the chamber."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
