      | 45613 -> { ItemTypeData.id= 45613; name= "Tengu Propulsion - Interdiction Nullifier"; published= true; description= "Dubbed the “interdiction nullifier” by the Guristas, who suffered its first introduction on the battlefield, this subsystem grants a startling and unprecedented capability; an immunity to non-targeted interdiction such as mobile warp disruptors and interdiction spheres.     The origins of the first “nullifier” designs are shrouded in mystery, but the subsystem's initial production of is thought to have taken place soon after the wormhole openings, and well before the technology became widespread knowledge. Not long after the first Tengu were designed, the Caldari Navy intercepted emergency transmissions from Guristas fleets across Venal, Tenal and Vale of the Silent. All of the reports made mention of Loki-class vessels slipping past defensive deployments and into core Guristas territory despite all efforts to stop the ships or slow them down.      Following these reports, rumors spread that other groups began to discover and implement this extraordinary new technology, and yet of all the factions that leapt upon the opportunity, none were so eager or ruthless in their own race to capitalize as the independent capsuleer and pirate organizations that make the nullsec frontiers their home.  "; marketGroupId= Some(1135); groupId= 957; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 1376; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 161; value= 40.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 1539; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 1400000.000000 }; { DogmaAttributeValueData.attributeId = 422; value= 3.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 552; value= 20.000000 }; { DogmaAttributeValueData.attributeId = 9; value= 40.000000 }; { DogmaAttributeValue